import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    state = {
      contacts: []
    }
  }

  componentDidMount() {
        fetch('http://jsonplaceholder.typicode.com/users')
        .then(res => res.json())
        .then((data) => {
          this.setState({ contacts: data })
        })
        .catch(console.log)
  }

  render() {
    return (
      <div className="App">
        {this.state.contacts}
      </div>
    );
  }
}

export default App;
